    setEmail(localStorage.getItem("hello"));
    axios.post("http://localhost:5000/req_data", Email).then((response) => {
      console.log(response.data.message);
    }).catch(function (error) {
      console.log(error);
    });
  } else {
    setUser(null);
  }
